                        "rating": 1,
                        "relative_time_description": "a year ago",
                        "text": "Had a terrible experience when one of our relatives was hospitalized years ago.\n\nI suggest that you pay with your insurance rather than paying in cash or credit card; because if you use your insurance, the hospital will not dare to mess with your bill since there is always a verification conducted by the insurance company. Meanwhile, if you pay in cash or credit card, they allegedly leave the patient's family waiting for a long time during checkout, and when they presented the bill, many strange items appear on the paper. Little can you do during this time since the cashier shows a tense and grumpy face while the patient is eager to go home as soon as possible.\n\nCritical moment like this is presumably used by the hospital to get additional income. But then it happened several years ago.",
